import React from 'react';

function Projects() {
    return (
        <div>
            <h1>Project</h1>
            <h2>Sound Engineering Project </h2>
            <p>Implemented a C++ pipeline to convert text-based musical notation into sound files by
                using queues and Karplus-Strong algorithm</p>
            <br/>
            <h2>Machine Learning Project for Land Conversion Prediction </h2>
            <p>Collaborated with a 6-person team to fine-tune a neural network for The Land Trust
                for Tennessee using Python, scikit-learn, PyTorch, and ArcGIS</p>
        </div>
    );
}

export default Projects;
